import {GET_DOGS} from '../constants'
import axios from 'axios'

export function getDogs (){
  return function (dispatch){
    fetch("http://localhost:3001/home/dogs", {
      "method": "GET",
      "mode": 'no-cors'
    })
    .then(response => response.json())
    .then(json => console.log(json)) 
    }
}
